/**
 * Created by Life_Sucks on 2016-05-06.
 */
/*HTML 엘리먼트들의 상태를 나타내는 객체들 파일*/
sideMenueObject = {
    door : "open",
    width : 250,
    Navigation : [
        {
            title : "Main",
            icon : "glyphicon glyphicon-home",
            link : "/"
        },
        {
            title : "Favorite",
            icon : "glyphicon glyphicon-thumbs-up",
            link : "/favorite"
        },
        {
            title : "User",
            icon : "glyphicon glyphicon-user"
        }
    ]
};

profileObject = {
    dropdown : "invisible"
};
